//引入Vue
import Vue from "vue";
//引入App
import App from "./App.vue"

const Demo=Vue.extend({})
const d=new Demo()

Vue.prototype.demo_vc=d
//创建vm
new Vue({
    el:"#root",
    render:createElement=>createElement(App),
    beforeCreate(){
        Vue.prototype.demo_vc=this
    }
})
